import React,{useState} from "react";
import JSONDATA from "./Services.json";

export default function SearchServices() {
  const [data,setData]  = useState('')
  return (
    <>
      <section>
        <div className="container-fluid bg-light hght">
          <div className="container">
            <h1
              style={{
                color: "#3d403e",
                marginTop: "2px",
                marginBottom: "32px",
              }}
            >
              All Services
            </h1>
            <form class="d-flex  " role="search">
              <input
                class="form-control me-3 mb-4  service-input input-width"
                type="search"
                placeholder="Search"
                aria-label="Search"
              />
              <button class="btn btn-warning p-2 mb-4 btnn " type="submit">
                SEARCH
              </button>
            </form>

            <div className="row">
              <div className="col-md-4">
                <b>CONSULT AN EXPERT</b>
                {JSONDATA.map((val, key) => {
                  return (
                    <div>
                      <ul>
                        <li>
                          <a href="" className="search_ser">{val.consult}</a>
                        </li>
                      </ul>
                    </div>
                  );
                })}
              </div>

              <div className="col-md-4">
                <b>TAX & COMPLIANCE</b>
                {JSONDATA.map((val, key) => {
                  return (
                    <div>
                      <ul>
                        <li>
                          <a href="" className="search_ser">{val.tax}</a>
                        </li>
                      </ul>
                    </div>
                  );
                })}
              </div>

              <div className="col-md-4">
                <b>DOCUMENTATION</b>
                {JSONDATA.map((val, key) => {
                  return (
                    <div>
                      <ul>
                        <li>
                          <a href="" className="search_ser">{val.documentation}</a>
                        </li>
                      </ul>
                    </div>
                  );
                })}
              </div>
            </div>
          </div>
        </div>
      </section>
    </>
  );
}
